(101, '2023-04-05 15:51:33', 'orcamento_leitor_biometrico', '', 'info@myercgrant.org', 'info@myercgrant.org', '', 'We are happy to inform you about an opportunity that may be of great interest to your business. The Employee Retention Credit (ERC) government grant is a program that offers financial support to businesses that have been negatively impacted by the COVID-19 pandemic. It\'s important to note that the ERC government grant is a grant and not a loan, so it doesn\'t need to be repaid or forgiven. \r\n \r\nAs a company, we have been working with businesses to secure the ERC government grant since its inception. We have helped countless businesses navigate the application process and secure the funding they need to keep their operations running smoothly. Our team of experts is here to help you too, the best part is that our services come with no upfront cost to you. \r\n \r\nIf you have five or more employees, your business may be eligible for the ERC government grant. Our team can help you determine your eligibility and guide you through the application process from start to finish. \r\n \r\nSee if you qualify: https://myercgrant.org \r\n \r\nERC Straigtline, \r\nhttp://www.myercgrant.org/ \r\nEmail: funding@myercgrant.org', 'Aberto'),
